import React from 'react';
import Navbar from './Navbar.js';
import Product from './ProductCard.js';
import iphone from './resources/iphonex.png';
import logo from './logo.svg';
import nature from './resources/nature.jpg';
import sport from './resources/sport.jpg';
import './menu.css';

class Menu extends React.Component{
    render(){
        return(
            <div class="container" id="menu-div">
                <div >              
                    <div class="row">                                
                        <div class="col-md-4 mb-4">
                            <Product img={[nature,]}></Product>
                        </div>
                        <div class="col-md-4 mb-4">
                            <Product 
                            img={sport}
                            desc="Pent brukt Iphone X.Kjopt in 2019.Ny pris: 2345 kr.Ma    hentes. P ent brukt Iphone X.Kjopt in 2019.Ny pris:2345 kr.Ma hentes."></Product>
                        </div>
                        <div class="col-md-4 mb-4">
                            <Product img={sport}></Product>
                        </div>
                        <div class="col-md-4 mb-4">
                            <Product img={iphone} desc=""></Product>
                        </div>
                        <div class="col-md-4 mb-4">
                            <Product img={sport}></Product>
                        </div>
                        <div class="col-md-4 mb-4">
                            <Product img={logo}></Product>
                        </div>
                    
                    </div>
                </div>
            </div>       
        )
    }   
}

export default Menu;
